social_posts.post_text:
I’m excited to announce the openers for my tour! 
The talented @crandelion and my sibling @material_________ in Chicago.
@graciegray.mp3 in LA <3  @sidthecat 
@zelmastonemusic in SF <3
Can’t wait !!!

The vinyl of SPIRALS is finally here! I’ll be selling these tonight in LA at ghengis Cohen, and in SF at @cafedunord ! (There are still tickets available for SF!) they will be available online at nickleng.com after tour 🖤
I want to give another massive thanks and shout out to the incredible @endiksm for the artwork. I’ve been a fan of his work for years and I’m eternally honored to have the privilege  of using his work for my record . @bjarnetakata for these amazing photos . I’ll never forget those couple days, hanging and creating . You two are AMAZING. 
@buccolina for the creative direction, and @reachmoonbase for the graphic design . 🖤

